import React from "react";

function SetPlus (props) {
  let setplus
  let setminus
  let buttonStatus

  if (props.button===true) {
    buttonStatus=props.onClick2
    setplus=<div className="page__status__input"><input className="page__status__input--redact" onChange={props.onChange} value={props.status} type="text" name="redaction"/></div>
      }
  if (props.button===false) {
    buttonStatus=props.onClick1
    setminus=<div className="page__status__text">{props.status}</div>
      }
  return (
    <div className="page__status">
      <div className="page__status__header">
        Здравствуйте, Человек №58745874
      </div>
      <div className="page__status__link">
        <a onClick={buttonStatus}>Сменить статус</a>
      </div>
        {setplus}{setminus}
    </div>
  )
}

export default SetPlus
